import './App.css';

import { Routes, Route, BrowserRouter as Router } from 'react-router-dom'

import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';



function App() {
  return (
    <div className="App">
      <h1>Test react</h1>
      <Router>
        <Routes>
          <Route element={<HomePage />} path="/"/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
